	.list .item /deep/.ivu-radio-group-vertical .ivu-radio-wrapper{
		margin-bottom 15px;
	}
	.list{
		.item{
			.title{
				width 50%;
				height 34px;
				background-color #F5F7FA;
				padding 0 15px;
				margin-top 15px;
				.del{
					color #F5222D;
					cursor pointer;
				}

			}
			/deep/.ivu-form-item{
				margin-top 20px!important;
			}
		}
	}
	.table{
		/deep/.ivu-table-header table{
			border:0!important
		}
		/deep/.ivu-table-cell{
			padding 0!important
		}
		/deep/.ivu-table-border th, /deep/.ivu-table-border td{
			border-right unset;
		}
		/deep/.ivu-table td{
			height 59px;
		}
	}
	.productType {
	  width: 150px;
	  height: 60px;
	  background: #FFFFFF;
	  border-radius: 3px;
	  border: 1px solid #E7E7E7;
	  float: left;
	  text-align: center;
	  padding-top: 8px;
	  position: relative;
	  cursor: pointer;
	  line-height: 23px;
	  margin-right 12px;

	  &.on{
		  border-color #1890FF;
	  }

	  .name {
	    font-size: 14px;
	    font-weight: 600;
	    color: rgba(0, 0, 0, 0.85);
			&.on{
			  color #1890FF;
			}
	  }

	  .title {
	    font-size: 12px;
	    font-weight: 400;
	    color: #999999;
	  }

	  .jiao {
	    position: absolute;
	    bottom: 0;
	    right: 0;
	    width: 0;
	    height: 0;
	    border-bottom: 26px solid #1890FF;
	    border-left: 26px solid transparent;
	  }

	  .iconfont {
	    position: absolute;
	    bottom: -3px;
	    right: 1px;
	    color: #FFFFFF;
		font-size 12px;
	  }

	}
	.vxeTable{
		border-top:1px dotted #eee;
		margin-top 20px;
	}
	.formValidate{
		.list{
			.item{
				.bnt{
					font-size 13px;
					color: #1890FF;
					margin-top 10px;
					cursor pointer;
				}
			}
		}
		.tips{
			display: inline-bolck;
			font-size: 12px;
			font-weight: 400;
			color: #999999;
		}
		.addClass{
			color: #1890FF;
			margin-left 14px;
			padding 9px 0;
			cursor pointer;
		}
	}
	.imgPic{
		.info{
			width: 60%;
			margin-left: 10px;
		}
		.pictrue{
			height: 36px;
			margin: 7px 3px 0 3px;
			img{
				height: 100%;
				display: block;
			}
		}
	}
	.labelInput{
		border: 1px solid #dcdee2;
		width 50%;
		padding 0 5px;
		border-radius 5px;
		min-height 30px;
		cursor pointer;
		.span{
			 color: #c5c8ce;
		}
		.iconxiayi{
			font-size 12px
		}
	}
	.form-submit {
		  /deep/.ivu-card{
		  	border-radius: 0;
		  }
	    margin-bottom: 79px;

	    .fixed-card {
	        position: fixed;
	        right: 0;
	        bottom: 0;
	        left: 200px;
	        z-index: 99;
	        box-shadow: 0 -1px 2px rgb(240, 240, 240);

	        /deep/ .ivu-card-body {
	            padding: 15px 16px 14px;
	        }

	        .ivu-form-item {
	            margin-bottom: 0;
	        }

	        /deep/ .ivu-form-item-content {
	            margin-right: 124px;
	            text-align: center;
	        }

	        .ivu-btn {
	            height: 36px;
	            padding: 0 20px;
	        }
	    }
	}
	.new_tab {
  >>>.ivu-tabs-nav .ivu-tabs-tab{
      padding:4px 16px 20px !important;
      font-weight: 500;
  }
}
